import React from "react";
import "./style.css";

const styles = {
  jumbotronStyle: {
    background: "#DB7093",
    color: "white",
  },
  button: {
    color: "pink",
  },
};

function Title() {
  return (
    <div className="container">
      <div className="jumbotron" style={styles.jumbotronStyle}>
        <h1 style={styles.h1}>Password Generator</h1>
        <p>
          <button
            className="btn btn-primary btn-lg"
            style={styles.jumbotronStyle}
          >
            Generate Password
          </button>
        </p>
      </div>
    </div>
  );
}

export default Title;
